import React from "react"
import {useParams} from "react-router-dom"

export default function Right(props){
    let {count} = parseInt(useParams());
    let num = count;
    console.log("> ", Object.typeOf(count))
    return (
        Array(count).fill().map((ele, i) => <div key={i}> I'M A RIGHTY {count} </div>)
    )
}
